        padding:10px;
        margin:10px;
        border-radius:10px;
        cursor: pointer;

        .btn--text{
            font-size:14px;
            color: #fff;
            padding:5px;
        }

        .btn--text:hover{
            border-bottom: 1px solid #fff;

        }
    }


`

export const BtnComentario = styled.div `

.btn{


